void ui_event_QDscreenQDimg (lv_event_t *e)
{
    lv_event_code_t event_code = lv_event_get_code (e);

    if (event_code == LV_EVENT_GESTURE)
    {
        if ((lv_indev_get_gesture_dir (lv_indev_get_act ()) == LV_DIR_LEFT))
        {
            _ui_screen_change (&ui_APP,LV_SCR_LOAD_ANIM_NONE,1000,0,&ui_APP_screen_init);
            LoadRSU_Animation (ui_APP,0);
        } else if ((lv_indev_get_gesture_dir (lv_indev_get_act ()) == LV_DIR_BOTTOM))
        {
            _ui_screen_change (&ui_SETING,LV_SCR_LOAD_ANIM_NONE,1000,0,&ui_SETING_screen_init);
            LoadU_Animation (ui_SETING,0);
            int num = 1;
            lv_msg_send (2,&num);
        } else if ((lv_indev_get_gesture_dir (lv_indev_get_act ()) == LV_DIR_TOP))
        {
            _ui_screen_change (&ui_Bicycle,LV_SCR_LOAD_ANIM_NONE,1000,0,&ui_Bicycle_screen_init);
            LoadDS_Animation (ui_Bicycle,0);
        }
    }
}
