void ui_event_SETING (lv_event_t *e)
{
    static  int num = 1;
    lv_event_code_t event_code = lv_event_get_code (e);
    if (event_code == LV_EVENT_MSG_RECEIVED)
    {
        lv_msg_t *m = lv_event_get_msg (e);
        num = *(int *)lv_msg_get_payload (m);
    }
    if (event_code == LV_EVENT_SCROLL_END)
    {
        OLeaveU_Animation (ui_SETING,0);
        if(num == 1)
            _ui_screen_change (&ui_QDscreen,LV_SCR_LOAD_ANIM_FADE_OUT,800,0,&ui_QDscreen_screen_init);
        if(num == 2)
            _ui_screen_change (&ui_APP,LV_SCR_LOAD_ANIM_FADE_ON,800,0,&ui_APP_screen_init);
    }
}

